 @AamirKhan-ko2ye  Miller's planet is a fictional planet in the movie Interstellar (2014). According to the movie, one day on Miller's planet is equivalent to 7 years on Earth.

This is due to the planet's proximity to a massive black hole, Gargantua, which causes extreme gravitational time dilation. Time passes much slower on Miller's planet than on Earth, resulting in this dramatic difference in day length.

So, if you were to spend one day on Miller's planet, approximately 7 years would pass on Earth!

